("1","wc-admin-wc-helper-connection","info","en_US","Connect to Quản lý bán hàng.com","Connect to get important product notifications and updates.","{}","unactioned","woocommerce-admin","2020-09-19 16:20:27",NULL,"0","plain","","0","info"),
("2","wc-admin-onboarding-email-marketing","info","en_US","Tips, product updates, and inspiration","We\'re here for you - get tips, product updates and inspiration straight to your email box","{}","unactioned","woocommerce-admin","2020-09-19 16:20:28",NULL,"0","plain","","0","info"),
("3","wc-admin-marketing-intro","info","en_US","Connect with your audience","Grow your customer base and increase your sales with marketing tools built for Quản lý bán hàng.","{}","unactioned","woocommerce-admin","2020-09-19 16:20:28",NULL,"0","plain","","0","info"),
("4","wc-admin-learn-more-about-product-settings","info","en_US","Learn more about Product Settings","In this video you\'ll find information about configuring product settings, such as how they are displayed, editing inventory options and so on.","{}","unactioned","woocommerce-admin","2020-09-19 16:20:28",NULL,"0","plain","","0","info"),
("5","wc-update-db-reminder","update","en_US","Yêu cầu cập nhật cơ sở dữ liệu Quản lý bán hàng","Quản lý bán hàng đã được cập nhật! Để đảm bảo mọi thứ hoạt động trơn tru, chúng tôi cần cập nhật cơ sở dữ liệu lên bản mới nhất. Quá trình cập nhật cơ sở dữ liệu sẽ chạy nền và sẽ mất chút thời gian, hãy kiên nhẫn. Người dùng cao cấp có thể cập nhật thay thế qua <a href=\"https://github.com/woocommerce/woocommerce/wiki/Upgrading-the-database-using-WP-CLI\">WP CLI</a>.","{}","unactioned","woocommerce-core","2020-09-19 16:21:39",NULL,"0","plain","","0","info"),
("6","wc-admin-mobile-app","info","en_US","Install Woo mobile app","Install the Quản lý bán hàng mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.","{}","unactioned","woocommerce-admin","2020-09-22 18:01:32",NULL,"0","plain","","0","info");
